const useStyles = makeStyles((theme) => ({
  root: {
    boxShadow: theme.palette.effectStyles.backGlowCards.boxShadow,
    borderRadius: '20px',
  },
}));

const Chart = ({ className }) => {
  const classes = useStyles();

  const initialState = {
    min: [],
    max: [],
  };

  const [points, setPoints] = useState(initialState);

  const handleSetPoints = function(v) {
    if (this.type === 'min') {
      setPoints((prevPoints) => ({
        ...prevPoints,
        min: [v],
      }));
    } else if (this.type === 'max') {
      setPoints((prevPoints) => ({
        ...prevPoints,
        max: [v],
      }));
    }
  };

  const handleMouseLeave = useCallback(() => {
    setPoints(initialState);
  }, []);

  const tickFormat = (d) => monthNames[new Date(d).getMonth()];

  const historicalMinTemp = historical.time.map((item, index) => {
    return {
      x: new Date(item).getTime(),
      y: historical['t2m_min'][index],
    }
  });

  const historicalMaxTemp = historical.time.map((item, index) => {
    return {
      x: new Date(item).getTime(),
      y: historical['t2m_max'][index],
    }
  });

  const minY = Math.min(...historicalMinTemp.map((d) => d.y));
  const maxY = Math.max(...historicalMaxTemp.map((d) => d.y));

  const forecastMinArr = [].concat.apply([], Object.values(forecast['t2m_min']));
  const forecastMaxArr = [].concat.apply([], Object.values(forecast['t2m_max']));

  const forecastMinTemp = forecast.time.map((item, index) => {
    return {
      x: new Date(item).getTime(),
      y: forecastMinArr[index],
    }
  });

  const forecastMaxTemp = forecast.time.map((item, index) => {
    return {
      x: new Date(item).getTime(),
      y: forecastMaxArr[index],
    }
  });

  const climMinLightenY0Arr = [];
  const climMinLightenY1Arr = [];
  const climMinDarkenY0Arr = [];
  const climMinDarkenY1Arr = [];

  for (let key in clim['t2m_min']) {
    if (+key === 0.05) {
      climMinLightenY0Arr.push(...clim['t2m_min'][key]);
    } else if (+key === 0.95) {
      climMinLightenY1Arr.push(...clim['t2m_min'][key]);
    } else if (+key === 0.25) {
      climMinDarkenY0Arr.push(...clim['t2m_min'][key]);
    } else if (+key === 0.75) {
      climMinDarkenY1Arr.push(...clim['t2m_min'][key]);
    }
  }

  const climMinLighten = clim.time.map((item, index) => {
    return {
      x: new Date(item).getTime(),
      y0: climMinLightenY0Arr[index],
      y: climMinLightenY1Arr[index],
    }
  });

  const climMinDarken = clim.time.map((item, index) => {
    return {
      x: new Date(item).getTime(),
      y0: climMinDarkenY0Arr[index],
      y: climMinDarkenY1Arr[index],
    }
  });

  const climMaxLightenY0Arr = [];
  const climMaxLightenY1Arr = [];
  const climMaxDarkenY0Arr = [];
  const climMaxDarkenY1Arr = [];

  for (let key in clim['t2m_max']) {
    if (+key === 0.05) {
      climMaxLightenY0Arr.push(...clim['t2m_max'][key]);
    } else if (+key === 0.95) {
      climMaxLightenY1Arr.push(...clim['t2m_max'][key]);
    } else if (+key === 0.25) {
      climMaxDarkenY0Arr.push(...clim['t2m_max'][key]);
    } else if (+key === 0.75) {
      climMaxDarkenY1Arr.push(...clim['t2m_max'][key]);
    }
  }

  const climMaxLighten = clim.time.map((item, index) => {
    return {
      x: new Date(item).getTime(),
      y0: climMaxLightenY0Arr[index],
      y: climMaxLightenY1Arr[index],
    }
  });

  const climMaxDarken = clim.time.map((item, index) => {
    return {
      x: new Date(item).getTime(),
      y0: climMaxDarkenY0Arr[index],
      y: climMaxDarkenY1Arr[index],
    }
  });

  return (
    <>
      <ChartActions />
      <Box className="chart-grid">
        <Card className={clsx(classes.root, className)}>
          <CardContent>
            <div className="chart-block">
              <Typography className="y-label">
                Tempereture in °F
              </Typography>
              <FlexibleWidthXYPlot
                height={500}
                xType="time"
                onMouseLeave={handleMouseLeave}
              >
                <ChartViewer points={points} />
                <VerticalGridLines />
                <HorizontalGridLines />
                <AreaSeries
                  data={climMaxLighten}
                  color="#FFC1C3"
                />
                <AreaSeries
                  data={climMaxDarken}
                  color="#FF8D91"
                />
                <AreaSeries
                  data={climMinLighten}
                  color="#D9ECFF"
                />
                <AreaSeries
                  data={climMinDarken}
                  color="#B0D2F6"
                />
                <LineSeries
                  color="#446EA1"
                  data={historicalMinTemp}
                  curve="curveMonotoneX"
                  onNearestX={handleSetPoints.bind({ type: 'min' })}
                />
                <LineSeries
                  color="#FF3D3D"
                  data={historicalMaxTemp}
                  curve="curveMonotoneX"
                  onNearestX={handleSetPoints.bind({ type: 'max' })}
                />
                <LineSeries
                  color="#446EA1"
                  data={forecastMinTemp}
                  curve="curveMonotoneX"
                  strokeStyle="dashed"
                />
                <LineSeries
                  color="#FF3D3D"
                  data={forecastMaxTemp}
                  curve="curveMonotoneX"
                  strokeStyle="dashed"
                />
                {
                  points.min.length || points.max.length ? (
                    <LineSeries
                      data={[{
                        x: points.min.length ? points.min[0].x : points.max[0].x,
                        y: minY
                      }, {
                        x: points.min.length ? points.min[0].x : points.max[0].x,
                        y: maxY
                      }]}
                      strokeStyle="dashed"
                      color="#707070"
                    />
                  ) : null
                }
                {
                  points.min.length ? (
                    <MarkSeries
                      data={points.min}
                      color="#446EA1"
                    />
                  ) : null
                }
                {
                  points.max.length ? (
                    <MarkSeries
                      data={points.max}
                      color="#FF152F"
                    />
                  ) : null
                }
                <XAxis tickFormat={tickFormat} />
                <YAxis className="y-axis" />
              </FlexibleWidthXYPlot>
            </div>
          </CardContent>
        </Card>
        <ChartHeader />
      </Box>
    </>
  )
};

Chart.propTypes = {
  className: PropTypes.string,
};

export default Chart;
